import{d as p}from"./app.fce06a0c.js";import{_ as e}from"./plugin-vue_export-helper.21dcd24c.js";const r={},a=p('<h1 id="_1-7-\u6709\u5173\u5728c-\u91CC\u7F16\u7A0B\u7684\u601D\u8003" tabindex="-1"><a class="header-anchor" href="#_1-7-\u6709\u5173\u5728c-\u91CC\u7F16\u7A0B\u7684\u601D\u8003" aria-hidden="true">#</a> 1.7 \u6709\u5173\u5728C++\u91CC\u7F16\u7A0B\u7684\u601D\u8003</h1><p>\u5728\u7406\u60F3\u7684\u60C5\u51B5\u4E0B\uFF0C\u4F60\u9700\u8981\u901A\u8FC7\u4E09\u4E2A\u6B65\u9AA4\u5B8C\u6210\u8BBE\u8BA1\u4E00\u4E2A\u7A0B\u5E8F\u7684\u5DE5\u4F5C\u3002\u9996\u5148\uFF0C\u4F60\u53D6\u5F97\u5BF9\u95EE\u9898\u7684\u4E00\u4E2A\u6E05\u6670\u7684\u7406\u89E3\uFF08\u5206\u6790\uFF09\uFF1B\u800C\u540E\u4F60\u6807\u8BC6\u51FA\u5728\u4E00\u4E2A\u89E3\u51B3\u65B9\u6848\u6240\u6D89\u53CA\u7684\u5173\u952E\u6027\u6982\u5FF5\uFF08\u8BBE\u8BA1\uFF09\uFF1B\u6700\u540E\uFF0C\u4F60\u7528\u4E00\u4E2A\u7A0B\u5E8F\u8868\u8FBE\u8FD9\u4E2A\u89E3\u51B3\u65B9\u6848\uFF08\u7F16\u7A0B\uFF09\u3002\u7136\u800C\uFF0C\u95EE\u9898\u7684\u7EC6\u8282\u548C\u89E3\u51B3\u65B9\u6848\u4E2D\u7684\u6982\u5FF5\uFF0C\u5E38\u5E38\u53EA\u6709\u901A\u8FC7\u5728\u4E00\u4E2A\u7A0B\u5E8F\u4E2D\u63CF\u8FF0\u5B83\u4EEC\uFF0C\u4EE5\u53CA\u8BA9\u7A0B\u5E8F\u4EE5\u53EF\u63A5\u53D7\u7684\u65B9\u5F0F\u8FD0\u884C\u7684\u52AA\u529B\u4E4B\u4E0B\uFF0C\u624D\u80FD\u771F\u6B63\u88AB\u6E05\u695A\u5730\u7406\u89E3\u3002\u800C\u8FD9\u6B63\u662F\u7A0B\u5E8F\u8BBE\u8BA1\u8BED\u8A00\u9009\u62E9\u7684\u5173\u952E\u4E4B\u5904\u3002</p><p>\u5728\u5927\u90E8\u5206\u5E94\u7528\u4E2D\u90FD\u5B58\u5728\u4E00\u4E9B\u6982\u5FF5\uFF0C\u5B83\u4EEC\u5F88\u4E0D\u5BB9\u6613\u8868\u793A\u4E3A\u67D0\u4E2A\u57FA\u672C\u7C7B\u578B\uFF0C\u4E5F\u4E0D\u5BB9\u6613\u8868\u8FF0\u4E3A\u6CA1\u6709\u4E0E\u4E4B\u5173\u8054\u7684\u6570\u636E\u7684\u51FD\u6570\u3002\u9047\u5230\u4E00\u4E2A\u8FD9\u6837\u7684\u6982\u5FF5\uFF0C\u8BF7\u5728\u7A0B\u5E8F\u91CC\u58F0\u660E\u4E00\u4E2A\u7C7B\u53BB\u8868\u793A\u5B83\u3002\u4E00\u4E2AC++\u7C7B\u5C31\u662F\u4E00\u4E2A\u7C7B\u578B\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0C\u5B83\u523B\u753B\u4E86\u8FD9\u4E2A\u7C7B\u7684\u5BF9\u8C61\u7684\u884C\u4E3A\uFF1B\u5B83\u4EEC\u5982\u4F55\u5EFA\u7ACB\uFF0C\u53EF\u4EE5\u88AB\u5982\u4F55\u64CD\u4F5C\uFF0C\u4EE5\u53CA\u5B83\u4EEC\u5982\u4F55\u9500\u6BC1\u3002\u4E00\u4E2A\u7C7B\u53EF\u80FD\u4E5F\u523B\u753B\u4E86\u8FD9\u4E9B\u5BF9\u8C61\u5982\u4F55\u8868\u793A\uFF0C\u867D\u7136\u5728\u8BBE\u8BA1\u4E00\u4E2A\u7A0B\u5E8F\u7684\u65E9\u671F\u9636\u6BB5\u8FD9\u5E76\u4E0D\u662F\u4E00\u4E2A\u4E3B\u8981\u8003\u8651\u3002\u5199\u51FA\u597D\u7684\u7A0B\u5E8F\uFF0C\u6700\u5173\u952E\u7684\u5C31\u662F\u53BB\u8BBE\u8BA1\u8FD9\u4E9B\u7C7B\uFF0C\u4F7F\u5B83\u4EEC\u4E2D\u7684\u6BCF\u4E00\u4E2A\u90FD\u80FD\u5F88\u6E05\u695A\u5730\u8868\u793A\u67D0\u4E2A\u6982\u5FF5\u3002\u8FD9\u7ECF\u5E38\u610F\u5473\u7740\u4F60\u5FC5\u987B\u96C6\u4E2D\u6CE8\u610F\u4E00\u4E9B\u8FD9\u6837\u7684\u95EE\u9898\uFF1B\u8FD9\u4E2A\u7C7B\u7684\u5BF9\u8C61\u5E94\u8BE5\u5982\u4F55\u5EFA\u7ACB\uFF1F\u8FD9\u4E2A\u7C7B\u7684\u5BF9\u8C61\u80FD\u591F\u88AB\u590D\u5236\uFF0F\u9500\u6BC1\u5417\uFF1F\u4EC0\u4E48\u64CD\u4F5C\u80FD\u591F\u4F5C\u7528\u4E8E\u8FD9\u79CD\u5BF9\u8C61\uFF1F\u5982\u679C\u5BF9\u8FD9\u7C7B\u95EE\u9898\u4E0D\u5B58\u5728\u5F88\u597D\u7684\u56DE\u7B54\uFF0C\u5BF9\u5E94\u7684\u6982\u5FF5\u6216\u8BB8\u662F\u4ECE\u4E00\u5F00\u59CB\u5C31\u5F88\u4E0D\u201C\u6E05\u695A\u201D\u3002\u8FD9\u65F6\u518D\u591A\u60F3\u60F3\u6709\u5173\u7684\u95EE\u9898\u4EE5\u53CA\u4E3A\u5B83\u6240\u8BBE\u5B9A\u7684\u89E3\u51B3\u65B9\u6848\uFF0C\u800C\u4E0D\u662F\u7ACB\u5373\u5F00\u59CB\u53BB\u56F4\u7ED5\u7740\u90A3\u4E2A\u95EE\u9898\u7F16\u7801\uFF0C\u8FD9\u6837\u505A\u53EF\u80FD\u662F\u4E2A\u5F88\u597D\u7684\u4E3B\u610F\u3002</p><p>\u6700\u5BB9\u6613\u5904\u7406\u7684\u6982\u5FF5\u662F\u90A3\u4E9B\u6709\u7740\u4F20\u7EDF\u6570\u5B66\u5F62\u5F0F\u7684\u4E1C\u897F\uFF1A\u5404\u79CD\u5404\u6837\u7684\u6570\uFF0C\u96C6\u5408\uFF0C\u51E0\u4F55\u5F62\u72B6\u7B49\u3002\u57FA\u4E8E\u6587\u672C\u7684I/O\u3001\u5B57\u7B26\u4E32\u3001\u57FA\u672C\u5BB9\u5668\u3001\u5BF9\u8FD9\u4E9B\u5BB9\u5668\u7684\u57FA\u672C\u7B97\u6CD5\uFF0C\u4EE5\u53CA\u4E00\u4E9B\u6570\u5B66\u7C7B\u90FD\u662F\u6807\u51C6C++\u5E93\u7684\u7EC4\u6210\u90E8\u5206\u3002\u9664\u6B64\u4E4B\u5916\uFF0C\u8FD8\u5B58\u5728\u7740\u8BB8\u591A\u53EF\u4EE5\u4F7F\u7528\u7684\u652F\u6301\u901A\u7528\u7684\u6216\u8005\u5404\u79CD\u9886\u57DF\u4E13\u7528\u6982\u5FF5\u7684\u4EE4\u4EBA\u773C\u82B1\u7F2D\u4E71\u7684\u5E93\u3002</p><p>\u6982\u5FF5\u4E0D\u4F1A\u5B58\u5728\u4E8E\u771F\u7A7A\u4E4B\u4E2D\uFF1B\u603B\u662F\u5B58\u5728\u7740\u76F8\u4E92\u5173\u8054\u7684\u4E00\u7C07\u7C07\u7684\u6982\u5FF5\u3002\u5C06\u7A0B\u5E8F\u91CC\u5404\u4E2A\u7C7B\u6309\u5B83\u4EEC\u4E4B\u95F4\u7684\u5173\u7CFB\u7EC4\u7EC7\u8D77\u6765--\u5373\u786E\u5B9A\u4E00\u4E2A\u89E3\u51B3\u65B9\u6848\u6240\u6D89\u53CA\u5230\u7684\u4E0D\u540C\u6982\u5FF5\u4E4B\u95F4\u7684\u51C6\u786E\u5173\u7CFB---\u5E38\u5E38\u6BD4\u9996\u5148\u5355\u72EC\u5217\u51FA\u4E00\u4E9B\u7C7B\u66F4\u56F0\u96BE\u3002\u6700\u597D\u522B\u628A\u7ED3\u679C\u5F04\u6210\u4E86\u4E00\u9505\u6D46\u7CCA\uFF0C\u5176\u4E2D\u7684\u6BCF\u4E00\u4E2A\u7C7B\uFF08\u6982\u5FF5\uFF09\u90FD\u76F8\u4E92\u4F9D\u8D56\u3002\u8003\u8651\u4E24\u4E2A\u7C7B\uFF0CA\u548CB\u3002\u50CF\u201CA\u8C03\u7528B\u7684\u51FD\u6570\u201D\uFF0C\u201CA\u5EFA\u7ACB\u8D77\u4E00\u4E9BB\u201D\uFF0C\u201CA\u5305\u542B\u4E00\u4E2AB\u6210\u5458\u201D\u4E4B\u7C7B\u7684\u5173\u7CFB\u5F88\u5C11\u4F1A\u9020\u6210\u91CD\u8981\u7684\u95EE\u9898\u3002\u800C\u50CF\u201CA\u4F7F\u7528B\u7684\u6570\u636E\u201D\u4E4B\u7C7B\u7684\u5173\u7CFB\u901A\u5E38\u5E94\u8BE5\u80FD\u6E05\u9664\u6389\u3002</p><p>\u5A01\u529B\u6700\u5927\u7684\u4E00\u79CD\u7BA1\u7406\u590D\u6742\u6027\u7684\u667A\u529B\u5DE5\u5177\u5C31\u662F\u67D0\u79CD\u5C42\u6B21\u6027\u7684\u5E8F\u5173\u7CFB\uFF0C\u4E5F\u5C31\u662F\u8BF4\uFF0C\u5C06\u76F8\u4E92\u6709\u5173\u7684\u6982\u5FF5\u7EC4\u7EC7\u5230\u4E00\u4E2A\u6811\u5F62\u7ED3\u6784\u4E2D\uFF0C\u4F7F\u6700\u4E00\u822C\u7684\u6982\u5FF5\u6210\u4E3A\u6811\u6839\u3002\u5728C++\u91CC\uFF0C\u6D3E\u751F\u7C7B\u8868\u793A\u7684\u5C31\u662F\u8FD9\u79CD\u7ED3\u6784\u3002\u4E00\u4E2A\u7A0B\u5E8F\u5E38\u5E38\u80FD\u7EC4\u7EC7\u4E3A\u4E00\u7EC4\u7C7B\uFF0C\u6216\u8005\u4E00\u7EC4\u7C7B\u7684\u6709\u5411\u65E0\u73AF\u56FE\u3002\u8FD9\u65F6\uFF0C\u7A0B\u5E8F\u5458\u523B\u753B\u4E00\u7EC4\u57FA\u7C7B\uFF0C\u6BCF\u4E2A\u90FD\u6709\u5B83\u7684\u4E00\u7EC4\u6D3E\u751F\u7C7B\u3002\u865A\u51FD\u6570\u5E38\u5E38\u80FD\u88AB\u7528\u4E8E\u4E3A\u4E00\u4E2A\u6982\u5FF5\u7684\u6700\u4E00\u822C\u7248\u672C\uFF08\u4E00\u4E2A\u57FA\u7C7B\uFF09\u5B9A\u4E49\u64CD\u4F5C\u3002\u5982\u679C\u6709\u5FC5\u8981\uFF0C\u53EF\u4EE5\u9488\u5BF9\u7279\u5B9A\u7684\u7C7B\uFF08\u6D3E\u751F\u7C7B\uFF09\uFF0C\u5BF9\u8FD9\u4E9B\u64CD\u4F5C\u7684\u89E3\u91CA\u505A\u8FDB\u4E00\u6B65\u7684\u7CBE\u786E\u5316\u3002</p><p>\u6709\u65F6\uFF0C\u751A\u81F3\u4E00\u4E2A\u6709\u5411\u65E0\u73AF\u56FE\u770B\u8D77\u6765\u4E5F\u4E0D\u8DB3\u4EE5\u7EC4\u7EC7\u8D77\u4E00\u4E2A\u7A0B\u5E8F\u91CC\u7684\u6982\u5FF5\uFF1B\u6709\u4E9B\u6982\u5FF5\u4F3C\u4E4E\u5177\u6709\u5185\u5728\u7684\u76F8\u4E92\u4F9D\u8D56\u6027\u3002\u5728\u8FD9\u79CD\u60C5\u51B5\u4E0B\uFF0C\u6211\u4EEC\u5E94\u8BBE\u6CD5\u5C06\u8FD9\u79CD\u5FAA\u73AF\u4F9D\u8D56\u5173\u7CFB\u5C40\u90E8\u5316\uFF0C\u4F7F\u5B83\u4EEC\u4E0D\u4F1A\u5F71\u54CD\u7A0B\u5E8F\u7684\u6574\u4F53\u7ED3\u6784\u3002\u5982\u679C\u4F60\u65E0\u6CD5\u6E05\u9664\u8FD9\u79CD\u76F8\u4E92\u4F9D\u8D56\uFF0C\u4E5F\u65E0\u6CD5\u5C06\u5176\u5C40\u90E8\u5316\uFF0C\u90A3\u4E48\u4F60\u5F88\u53EF\u80FD\u8FDB\u5165\u4E86\u4E00\u4E2A\u56F0\u5883\uFF0C\u6CA1\u6709\u4E00\u79CD\u7A0B\u5E8F\u8BBE\u8BA1\u8BED\u8A00\u80FD\u591F\u5E2E\u4F60\u8DF3\u51FA\u6765\u3002\u9664\u975E\u4F60\u80FD\u8BBE\u60F3\u51FA\u5728\u57FA\u672C\u6982\u5FF5\u4E4B\u95F4\u7684\u67D0\u79CD\u5F88\u5BB9\u6613\u9648\u8FF0\u7684\u5173\u7CFB\uFF0C\u5426\u5219\u90A3\u4E2A\u7A0B\u5E8F\u591A\u534A\u4F1A\u53D8\u5F97\u65E0\u6CD5\u7BA1\u7406\u3002</p><p>\u89E3\u5F00\u4F9D\u8D56\u56FE\u7684\u4E00\u79CD\u6700\u597D\u7684\u5DE5\u5177\u5C31\u662F\u754C\u9762\u548C\u5B9E\u73B0\u7684\u6E05\u6670\u5206\u79BB\u3002\u62BD\u8C61\u7C7B\u662FC++\u5904\u7406\u8FD9\u79CD\u95EE\u9898\u7684\u57FA\u672C\u5DE5\u5177\u3002</p><p>\u5171\u6027\u7684\u53E6\u4E00\u79CD\u5F62\u5F0F\u53EF\u53EF\u4EE5\u901A\u8FC7\u6A21\u7248\u8868\u793A\u3002\u4E00\u4E2A\u7C7B\u6A21\u7248\u523B\u753B\u4E86\u4E00\u65CF\u7C7B\u3002\u4F8B\u5982\uFF0C\u4E00\u4E2A\u8868\u6A21\u677F\u523B\u753B\u4E86\u201CT\u7684\u8868\u201D\uFF0C\u5176\u4E2DT\u53EF\u4EE5\u662F\u4EFB\u4F55\u7C7B\u578B\u3002\u8FD9\u6837\uFF0C\u6A21\u677F\u5C31\u662F\u8FD9\u6837\u4E00\u79CD\u673A\u5236\uFF0C\u5B83\u523B\u753B\u7684\u662F\u5982\u4F55\u901A\u8FC7\u7ED9\u5B9A\u53E6\u4E00\u4E2A\u7C7B\u4F5C\u4E3A\u53C2\u8003\uFF0C\u5C31\u53EF\u4EE5\u751F\u6210\u51FA\u4E00\u4E2A\u65B0\u7684\u7C7B\u6765\u3002\u6700\u5E38\u89C1\u7684\u6A21\u677F\u662F\u5BB9\u5668\u7C7B\uFF0C\u4F8B\u5982\u8868\u3001\u6570\u7EC4\u548C\u5173\u8054\u6570\u7EC4\uFF0C\u4EE5\u53CA\u4F7F\u7528\u8FD9\u4E9B\u5BB9\u5668\u7684\u57FA\u672C\u7B97\u6CD5\u3002\u901A\u8FC7\u4F7F\u7528\u7EE7\u627F\u7684\u7C7B\u578B\u8868\u8FBE\u4E00\u4E2A\u7C7B\u53CA\u5176\u76F8\u5173\u51FD\u6570\u7684\u53C2\u6570\u5316\u901A\u5E38\u662F\u4E2A\u9519\u8BEF\uFF0C\u8FD9\u4EF6\u4E8B\u6700\u597D\u662F\u7528\u6A21\u677F\u505A\u3002</p><p>\u5E94\u8BE5\u8BB0\u4F4F\uFF0C\u8BB8\u591A\u7A0B\u5E8F\u8BBE\u8BA1\u5DE5\u4F5C\u80FD\u591F\u4EC5\u7528\u57FA\u672C\u7C7B\u578B\u3001\u6570\u636E\u7ED3\u6784\u3001\u666E\u901A\u51FD\u6570\u548C\u82E5\u5E72\u5E93\u7C7B\u5B8C\u6210\uFF0C\u8FD9\u6837\u505A\u65E2\u7B80\u5355\u53C8\u6E05\u6670\u3002\u6D89\u53CA\u5230\u5B9A\u4E49\u65B0\u7C7B\u578B\u7684\u5168\u5957\u88C5\u5907\u5E94\u5C3D\u91CF\u4E0D\u7528\uFF0C\u9664\u4E86\u5728\u90A3\u4E9B\u786E\u5B9E\u9700\u8981\u5B83\u4EEC\u7684\u5730\u65B9\u4EE5\u5916\u3002</p><p>\u95EE\u9898\u201C\u4E00\u4E2A\u4EBA\u600E\u6837\u624D\u80FD\u5728C++\u91CC\u5199\u51FA\u597D\u7684\u7A0B\u5E8F\uFF1F\u201D\u4E0E\u95EE\u9898\u201C\u4E00\u4E2A\u4EBA\u600E\u6837\u624D\u80FD\u5199\u51FA\u597D\u7684\u82F1\u8BED\u6563\u6587\u201D\u7C7B\u4F3C\u3002\u5B58\u5728\u7740\u4E24\u4E2A\u56DE\u7B54\uFF1A\u201C\u4E86\u89E3\u4F60\u60F3\u8BF4\u7684\u662F\u4EC0\u4E48\u201D\u4EE5\u53CA\u201C\u5B9E\u8DF5\uFF0C\u6A21\u4EFF\u597D\u7684\u4F5C\u54C1\u201D\u3002\u4E24\u8005\u90FD\u9002\u7528\u4E8EC++\uFF0C\u5C31\u50CF\u5B83\u4EEC\u9002\u7528\u4E8E\u82F1\u8BED\u4E00\u6837---\u53BB\u5B9E\u8DF5\u8FD9\u4E00\u60F3\u6CD5\u4E5F\u540C\u6837\u4E0D\u5BB9\u6613\u3002</p>',11);function c(t,_){return a}var s=e(r,[["render",c]]);export{s as default};
